script: |
  super -f text -I q11347.spq | sort > q11347.out

inputs:
  - name: q11347.spq
    data: |
      SELECT + ( COUNT ( * ) ) AS col0 FROM tab0 (FORMAT parquet) WHERE ( 7 ) NOT BETWEEN col2 * col2 * + 98 + + ( + col2 ) * + col1 AND 82 / - col1;
  - name: tab0

outputs:
  - name: q11347.out
    data: |
      3
